  false,\n\t\"url\": null,\n\t\"notes\": \"Malheur National Wildlife Refuge is located
  in the Northern Great Basin portion of southeastern Oregon. The refuge was established
  by Executive order of President Theodore Roosevelt in 1908 as an 81,786 acre u201cpreserve
  and breeding ground for native birdsu201d and was called the Lake Malheur Reservation.
  In following years the Blitzen Valley and the Double-O portion of the refuge were
  acquired. This report is a summary of conditions at Malheur from May 1 to August
  31, 1953. Climatic conditions, land acquisition, planning, administration, habitat
  management, wildlife, public use, maintenance and construction as well as other
  items of interest are all highlighted.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
